import ExpenseItem from "./components/ExpenseItem";
import expenses from "./components/expenses.txt";
function App() {

  return (
    <div>
      <h2>Let's get started!</h2>
      <ExpenseItem
        date={"23/06/2001"}
        title={"Car Insurance"}
        amount={expenses[0].amount}

      />

    </div>
  );
}

export default App;
